/// <summary>
/// Returns the default change tracking query.
/// </summary>
/// <returns>The default change tracking query.</returns>
public static Query defaultCTQuery()
{
    Query smmProspectQuery = new Query();

    var smmBusRelTableDS = smmProspectQuery.addDataSource(tableNum(smmBusRelTable));

    var qbdCompanyNAFCode = smmBusRelTableDS.addDataSource(tableNum(CompanyNAFCode));
    qbdCompanyNAFCode.joinMode(JoinMode::OuterJoin);
    qbdCompanyNAFCode.relations(true);

    var qbdHcmWorker = smmBusRelTableDS.addDataSource(tableNum(HcmWorker));
    qbdHcmWorker.joinMode(JoinMode::OuterJoin);
    qbdHcmWorker.relations(true);

    var qbdRetailExt = smmBusRelTableDS.addDataSource(tableNum(RetailSmmBusRelTable));
    qbdRetailExt.joinMode(JoinMode::OuterJoin);
    qbdRetailExt.relations(true);

    var qbdDimensionDAVS = smmBusRelTableDS.addDataSource(tableNum(DimensionSetEntity));
    qbdDimensionDAVS.joinMode(JoinMode::OuterJoin);
    qbdDimensionDAVS.addLink(fieldNum(smmBusRelTable, DefaultDimension), fieldNum(DimensionSetEntity, RecId));

    QueryBuildDataSource qbdDirParty = DirPartyBaseEntity::addChangeTrackingDataSourcesForPartyBase(smmBusRelTableDS, FieldNum(smmBusRelTable, Party));
    LogisticsPostalAddressBaseEntity::addChangeTrackingDataSourcesForAddressBase(qbdDirParty, fieldNum(DirPartyTable, PrimaryAddressLocation));

    return smmProspectQuery;
}

/// <summary>
/// Code to generate a computed column to indicate whether or not the prospect is a B2B prospect.
/// 
/// SQL to be generated should look like:
/// 
/// CASE
///     WHEN [alias for RetailSmmBusRelTable].RecId IS NOT NULL THEN 1
///     ELSE 0
/// END
/// </summary>
/// <returns>The SQL text used for the IsB2BProspect column.</returns>
private static str isB2BProspectColumn()
{
    str comparisson = SysComputedColumn::isNotNullExpression(
        SysComputedColumn::comparisonField(tableStr(smmProspectEntity), dataEntityDataSourceStr(smmProspectEntity, RetailSmmBusRelTable), fieldStr(RetailSmmBusRelTable, RecId)));

    return SysComputedColumn::if(comparisson,
        SysComputedColumn::returnLiteral(NoYes::Yes),
        SysComputedColumn::returnLiteral(NoYes::No));
}

/// <summary>
/// Sends a notification stating that the B2B prospect has been rejected. 
/// </summary>
/// <param name = "_smmProspectEntityRecord">The prospect record.</param>
/// <returns>An empty list since no records are changed by this request.</returns>
/// <remarks>
/// This used by Dataverse to trigger the e-mail notification.
/// Dataverse expects a list of RecordIds that have changed while processing this method, but since no Prospect data is changed, we will always return an empty list.
/// </remarks>
internal static List sendB2BRejectionEmail(Common _smmProspectEntityRecord)
{
    RetailEventNotificationAction::insertRetailENAction(RetailEventNotificationType::B2BProspectRejected, _smmProspectEntityRecord.RecId);

    return new List(Types::Int64);
}

