/// Dataverse expects a list of RecordIds that have changed while processing this method, but since no Prospect data is changed, we will always return an empty list.
/// </remarks>
internal static List sendB2BApprovalEmail(Common _smmProspectEntityRecord)
{
    RetailEventNotificationAction::insertRetailENAction(RetailEventNotificationType::B2BProspectApproved, _smmProspectEntityRecord.RecId);

    return new List(Types::Int64);
}
